import React from 'react';
import { Formik, Field, Form} from 'formik';
import * as yup from 'yup';
import { makeStyles} from '@material-ui/core';
import Grid from "@material-ui/core/Grid"; 
import Container from '@material-ui/core/Container';
import Box from "@material-ui/core/Box";
import moment from "moment";
import { borders } from '@material-ui/system';
import NavBar from './NavBar';
import TextField from '@material-ui/core/TextField';
import Typography from '@material-ui/core/Typography';
import { sizing } from '@material-ui/system';
import InputLabel from '@material-ui/core/InputLabel';
import Button from '@material-ui/core/Button';
import SaveIcon from '@material-ui/icons/Save';
const  useStyles = makeStyles((theme) => ({
formWrapper :{
  marginTop:theme.spacing(5),
  marginBottom:theme.spacing(8),
},
button: {
  margin: theme.spacing(1),
},
}))
const type = [
  {

    label: 'Optional',
  },
  {

    label: 'Fixed',
  },
]
const Location =[
{
label:'All Locations'
},
{
  label:'Bettendorf,IA'
},
{
  label:'India'
}
]
const defaultProps = {
  bgcolor: 'background.paper',
  m: 1,
  border: 1,
  style: { width: '70rem', height: '30rem' },
};
const INTIAL_FORM_STATE = {
   HOLIDAY_Id:'',
   DATE:'',
   Type:'',
   Location:'',
   Description:''
};
const validationSchema =yup.object({

})

function Create ()  {
   const classes = useStyles();
   const [anchorEl, setAnchorEl] = React.useState(null);
   const [currency, setCurrency] = React.useState('');
   const [selectedDate, setSelectedDate] = React.useState(new Date('2014-08-18T21:11:54'));
   const handleDateChange = (date) => {
    setSelectedDate(date);
  };

const handleChange =() =>{

}
  return(
    <Form>
    <Grid container display="flex" justifyContent="center" border={1} {...defaultProps}>

      <Box display="flex" justifyContent="center" border={1} {...defaultProps} >

      <Form class>

        <InputLabel htmlFor="Holiday Id" varient="h1" nowrap>Holiday Id:</InputLabel>


        <TextField id="outlined-basic" variant="outlined" style ={{width: '320%'}} />

        <InputLabel htmlFor="Date">Date:</InputLabel>
        <TextField id="outlined-basic" label="Outlined" variant="outlined" style ={{width: '320%'}}/><br></br>
        <InputLabel htmlFor="Holiday Type">Location:</InputLabel>
        <TextField
        style ={{width: '320%'}}
        id="filled-select-currency-native"
        select
        value={currency}
        onChange={handleChange}
        SelectProps={{
          native: true,
        }}

        variant="filled"
      >
      {Location.map((option) => (
        <option key={option.value} value={option.value}>
          {option.label}
        </option>
      ))}

      </TextField><br></br>

        <InputLabel htmlFor="Holiday Type">Holiday Type:</InputLabel>
        <TextField
        id="filled-select-currency-native"
        style ={{width: '320%'}}
        select
        label="Native select"
        value={currency}
        onChange={handleChange}
        SelectProps={{
          native: true,
        }}

        variant="filled"
      >
      {type.map((option) => (
        <option key={option.value} value={option.value}>
          {option.label}
        </option>
      ))}

      </TextField><br></br>


        <InputLabel htmlFor="Description">Description:</InputLabel>
        <TextField id="outlined-basic" label="Outlined" variant="outlined" style ={{width: '320%'}}/><br></br>
        <Button
        variant="contained"
        color="primary"
        size="large"
        className={classes.button}
        startIcon={<SaveIcon />}
      >
        Save
      </Button>
      <Button variant="contained">Goto:Holidays</Button>
        </Form>

      </Box>


    </Grid>
    </Form>

)}


export default Create;
